{'sentences': ['We’ve opened our newest branch at 376 N. Main Street in Southington.', 'We’re so happy to be able to bring our friendly personalized banking, wealth management, insurance services, and values to the Southington community.', 'Along with our friendly personalized service in the branch, we are happy to serve you with our Personal Teller Machine (PTM) technology.', 'This PTM technology allows you to interact with a live teller through two-way video for typical transactions such as making deposits and payments, withdrawals, transferring money, cashing checks, and more.

', 'In addition to building lifetime relationships by partnering with you to help identify and achieve your financial goals, our family partner Ion Investments offers wealth management and life insurance products for a healthy financial future.



']}
